class Admin{constructor(username,password,adminId){this.username=username,this.password=password,this.adminId=adminId}static adminStorage(){let admin;return admin=null===localStorage.getItem("admin")?[]:JSON.parse(localStorage.getItem("admin")),admin}static addAdmin(adminAccount){const admin=Admin.adminStorage();admin.push(adminAccount),localStorage.setItem("admin",JSON.stringify(admin))}}